import Header from './layout/js/Header';
import Body from './layout/js/Body'
import {useRef, useState} from "react";

function App() {
    const filter = useRef("");

    const getFilter = () => {return filter;};
    const setConditions = (conditions) => {filter.current = conditions};

    return (
        <div className="App">
            <Header getFilter={getFilter}/>
            <Body setConditions={setConditions}/>
        </div>
    );
}

export default App;
